import {ImageResponse} from 'next/server';

const backgroundImage =
  'data:image/png;base64,';

export async function generateOgImage({
  title,
}: {
  title: string;
}): Promise<ImageResponse> {
  return new ImageResponse(
    (
      <div style={{display: 'flex'}}>
        <img src={backgroundImage} alt="" width={1200} height={630} />
        <div
          style={{
            position: 'absolute',
            top: '0%',
            left: '0%',
            width: '100%',
            height: '100%',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#fff2dc',
          }}
        >
          <div
            style={{
              fontFamily: 'font-serif',
              fontSize: '5rem',
              // @ts-expect-error
              textWrap: 'balance',
            }}
          >
            {title}
          </div>
        </div>
      </div>
    ),
    {
      width: 1200,
      height: 630,
      // fonts: [
      // {
      //   name: 'font-serif',
      //   data: DMSerif,
      //   weight: 400,
      //   style: 'normal',
      // },
      // ],
    },
  );
}
